(3, 5, '_form', '<label> Ваше ім\'я\n    [text* your-name] </label>\n\n<label> Ваш email\n    [email* your-email] </label>\n\n<label> Тема\n    [text* your-subject] </label>\n\n<label> Ваше повідомлення (необов\'язково)\n    [textarea your-message] </label>\n\n[submit \"Відправити\"]'),
(4, 5, '_mail', 'a:8:{s:7:\"subject\";s:30:\"[_site_title] \"[your-subject]\"\";s:6:\"sender\";s:47:\"[_site_title] <wordpress@pizza.safe-valley.com>\";s:4:\"body\";s:221:\"Від: [your-name] <[your-email]>\nТема: [your-subject]\n\nТекст повідомлення:\n[your-message]\n\n-- \nЦе повідомлення було відправлено з сайту [_site_title] ([_site_url])\";s:9:\"recipient\";s:19:\"[_site_admin_email]\";s:18:\"additional_headers\";s:22:\"Reply-To: [your-email]\";s:11:\"attachments\";s:0:\"\";s:8:\"use_html\";i:0;s:13:\"exclude_blank\";i:0;}'),
(5, 5, '_mail_2', 'a:9:{s:6:\"active\";b:0;s:7:\"subject\";s:30:\"[_site_title] \"[your-subject]\"\";s:6:\"sender\";s:47:\"[_site_title] <wordpress@pizza.safe-valley.com>\";s:4:\"body\";s:160:\"Текст повідомлення:\n[your-message]\n\n-- \nЦе повідомлення було відправлено з сайту [_site_title] ([_site_url])\";s:9:\"recipient\";s:12:\"[your-email]\";s:18:\"additional_headers\";s:29:\"Reply-To: [_site_admin_email]\";s:11:\"attachments\";s:0:\"\";s:8:\"use_html\";i:0;s:13:\"exclude_blank\";i:0;}'),
(6, 5, '_messages', 'a:12:{s:12:\"mail_sent_ok\";s:92:\"Дякуємо за Ваше повідомлення. Воно було надіслане.\";s:12:\"mail_sent_ng\";s:180:\"Сталася помилка під час спроби відправити Ваше повідомлення. Будь ласка, спробуйте ще раз пізніше.\";s:16:\"validation_error\";s:167:\"Одне або декілька полів містять помилкові дані. Будь ласка, перевірте їх і спробуйте ще раз.\";s:4:\"spam\";s:180:\"Сталася помилка під час спроби відправити Ваше повідомлення. Будь ласка, спробуйте ще раз пізніше.\";s:12:\"accept_terms\";s:153:\"Ви повинні прийняти умови та положення перед тим, як відправляти Ваше повідомлення.\";s:16:\"invalid_required\";s:54:\"Будь ласка, заповніть це поле.\";s:16:\"invalid_too_long\";s:64:\"Це поле містить занадто довгі дані.\";s:17:\"invalid_too_short\";s:68:\"Це поле містить занадто короткі дані.\";s:13:\"upload_failed\";s:97:\"Під час завантаження файлу сталася невідома помилка.\";s:24:\"upload_file_type_invalid\";s:89:\"Вам не дозволено завантажувати файли цього типу.\";s:21:\"upload_file_too_large\";s:53:\"Завантажений файл завеликий.\";s:23:\"upload_failed_php_error\";s:80:\"Під час завантаження файлу сталася помилка.\";}'),
