(1507, 192, 'about_us_left_text', 'We were inspired by the Hawaiian Goddess of fruitfulness and prosperity called Papa. That is how we get our name and a piece of sun in each bowl. <br>\r\nAs Hawaiian cuisine is a symbiosis of many other cultures, from which they took the best - fresh fish, juicy fruits, many vegetables, and characteristic sour-salty spices with a spicy note.'),
(1505, 192, 'about_us_heading', 'Our Bowl  Love Story '),
(1506, 192, '_about_us_heading', 'field_6386506235454'),
(1160, 167, '_about_us_left_text', 'field_6386507135455'),
(1161, 167, 'about_us_right_text', 'As Hawaiian cuisine is a symbiosis of many other cultures, from which they took the best - fresh fish, juicy fruits, many vegetables, and characteristic sour-salty spices with a spicy note.<br>\r\n<br>\r\nPoke is healthy and valuable food. It\'s all about loving and respecting the planet and your body.\r\nWe offer freshly prepared Poke Bowls using traditional methods, the freshest fish, and only the best ingredients.'),
(1162, 167, '_about_us_right_text', 'field_6386508735456'),
(1163, 167, 'about_us_heading2', 'TEAM'),
(1164, 167, '_about_us_heading2', 'field_638650cc5e778'),
(1165, 167, 'about_us_text', 'And we promise our Hawaiian bowls will bowl you over.<br>\r\nTry it now!'),
