(1370, 173, '_about_us_heading', 'field_6386506235454'),
(1371, 173, 'about_us_left_text', 'That doesn’t mean it is worse or better. Of course, no. But this warm, sweet Hawaiian sun…sometimes we just need it so hard.<br>\r\nSo we found a solution. And you don’t even need to book a bungalow at the end of the day. Just order fresh Hawaiian Poke Bowls in Edinburgh from Papa Poke.<br>\r\n<br>\r\nWe were inspired by the Hawaiian Goddess of fruitfulness and prosperity called Papa. That is how we get our name and a piece of sun in each bowl. '),
(1372, 173, '_about_us_left_text', 'field_6386507135455'),
(1373, 173, 'about_us_right_text', 'As Hawaiian cuisine is a symbiosis of many other cultures, from which they took the best - fresh fish, juicy fruits, many vegetables, and characteristic sour-salty spices with a spicy note.<br>\r\n<br>\r\nPoke is healthy and valuable food. It\'s all about loving and respecting the planet and your body.\r\nWe offer freshly prepared Poke Bowls using traditional methods, the freshest fish, and only the best ingredients.'),
(1374, 173, '_about_us_right_text', 'field_6386508735456'),
(1375, 173, 'about_us_heading2', 'TEAM'),
(1376, 173, '_about_us_heading2', 'field_638650cc5e778'),
(1377, 173, 'about_us_text', 'And we promise our Hawaiian bowls will bowl you over.<br>\r\nTry it now!'),
