(1394, 173, '_heading_h1', 'field_6386636ed0cee'),
(1395, 173, 'heading_text', 'Aloha, sir or madam!\r\nScotland is nothing like Hawaii, innit, my friend?)<br>\r\n<br>\r\nThat doesn’t mean it is worse or better. Of course, no. But this warm, sweet Hawaiian sun…sometimes we just need it so hard.\r\nSo we found a solution. And you don’t even need to book a bungalow at the end of the day. Just order fresh Hawaiian Poke Bowls in Edinburgh from Papa Poke.'),
