(1657, 194, 'about_us_heading', 'Our Bowl  Love Story '),
(1658, 194, '_about_us_heading', 'field_6386506235454'),
(1659, 194, 'about_us_left_text', 'We were inspired by the Hawaiian Goddess of fruitfulness and prosperity called Papa. That is how we get our name and a piece of sun in each bowl. <br>\r\n<br>\r\nAs Hawaiian cuisine is a symbiosis of many other cultures, from which they took the best - fresh fish, juicy fruits, many vegetables, and characteristic sour-salty spices with a spicy note.'),
(1660, 194, '_about_us_left_text', 'field_6386507135455'),
(1661, 194, 'about_us_right_text', 'Poke is healthy and valuable food. It\'s all about loving and respecting the planet and your body.\r\nWe offer freshly prepared Poke Bowls using traditional methods, the freshest fish, and only the best ingredients.'),
(1662, 194, '_about_us_right_text', 'field_6386508735456'),
(1663, 194, 'about_us_heading2', 'TEAM'),
(1664, 194, '_about_us_heading2', 'field_638650cc5e778'),
(1665, 194, 'about_us_text', 'And we promise our Hawaiian bowls will bowl you over.<br>\r\nTry it now!'),
(1666, 194, '_about_us_text', 'field_638650e15e779'),
(1667, 194, 'about_us_photo', '43'),
