(1677, 194, 'contact_info_2', '<a href=\"mailto:write.to@papapoke.com\">write.to@papapoke.com</a>\r\n<a href=\"mailto:support@papapoke.com\">\r\nsupport@papapoke.com</a>'),
(1678, 194, '_contact_info_2', 'field_63865bfa7b7d1'),
(1679, 194, 'contact_info_3', '<a href=\"tel:+371098342235\">+371 098 34 2235</a>\r\n<a href=\"tel:+371067542678\">+371 067 54 2678</a>'),
(1680, 194, '_contact_info_3', 'field_63865bff7b7d2'),
(1681, 194, 'heading_h1', 'sunny  hawaiian  bowls'),
(1682, 194, '_heading_h1', 'field_6386636ed0cee'),
(1683, 194, 'heading_text', 'Aloha, sir or madam!\r\nScotland is nothing like Hawaii, innit, my friend?)<br>\r\n<br>\r\nThat doesn’t mean it is worse or better. Of course, no. But this warm, sweet Hawaiian sun…sometimes we just need it so hard.\r\nSo we found a solution. And you don’t even need to book a bungalow at the end of the day. Just order fresh Hawaiian Poke Bowls in Edinburgh from Papa Poke.'),
