(2216, 210, 'about_us_heading', 'Our Bowl  Love Story '),
(2217, 210, '_about_us_heading', 'field_6386506235454'),
(2218, 210, 'about_us_left_text', 'We were inspired by the Hawaiian Goddess of fruitfulness and prosperity called Papa. That is how we get our name and a piece of sun in each bowl. <br>\r\n<br>\r\nAs Hawaiian cuisine is a symbiosis of many other cultures, from which they took the best - fresh fish, juicy fruits, many vegetables, and characteristic sour-salty spices with a spicy note.'),
(2219, 210, '_about_us_left_text', 'field_6386507135455'),
(2220, 210, 'about_us_right_text', 'Poke is healthy and valuable food. It\'s all about loving and respecting the planet and your body.\r\nWe offer freshly prepared Poke Bowls using traditional methods, the freshest fish, and only the best ingredients.'),
(2221, 210, '_about_us_right_text', 'field_6386508735456'),
(2222, 210, 'about_us_heading2', 'TEAM'),
(2223, 210, '_about_us_heading2', 'field_638650cc5e778'),
(2224, 210, 'about_us_text', 'And we promise our Hawaiian bowls will bowl you over.<br>\r\nTry it now!'),
(2225, 210, '_about_us_text', 'field_638650e15e779'),
