(2950, 254, 'about_us_right_text', 'Poke is a healthy and nourishing choice, rooted in love and respect for both the planet and your body.\r\n\r\nWe take pride in offering freshly prepared Poke Bowls, crafted using traditional methods, the freshest fish, and only the finest ingredients.'),
