(3718, 287, 'contact_info_1', '<p>47 Elm Row</p>\r\n<p>EH7 4AH</p>'),
(3719, 287, '_contact_info_1', 'field_63865bd97b7d0'),
(3720, 287, 'contact_info_2', '<a href=\"mailto:contactus@papapoke.co.uk\">contactus@papapoke.co.uk</a>\r\n'),
(3721, 287, '_contact_info_2', 'field_63865bfa7b7d1'),
(3722, 287, 'contact_info_3', '<a href=\"tel:+ 447754040925\">+ 447754040925 </a>\r\n'),
(3723, 287, '_contact_info_3', 'field_63865bff7b7d2'),
(3724, 287, 'heading_h1', 'Bowls & Rolls '),
(3725, 287, '_heading_h1', 'field_6386636ed0cee'),
(3726, 287, 'heading_text', '<p>Aloha, sir or madam!</p>\r\n<p>Scotland is nothing like Hawaii, innit, my friend?)</p>\r\n<p>That doesn’t mean it is worse or better. Of course, no. But this warm, sweet Hawaiian sun... sometimes we just need it so hard.</p>\r\n<p>So we found a solution. And you don’t even need to book a bungalow at the end of the day. Just order fresh Hawaiian Poke Bowls in Edinburgh from Papa Poke.</p>\r\n<!-- <img src=\"/wp-content/uploads/2025/08/banner-bowl.png\" alt=\"PapaPoke Bowl\" style=\"max-width:300px;border-radius:12px;\"> -->\r\n'),
(3727, 287, '_heading_text', 'field_63866384d0cef'),
(3728, 287, 'contact_heading_right', 'Check<br>\r\ndelivery options'),
