(3778, 288, 'about_us_left_text', 'We drew inspiration from Papa, the Hawaiian goddess of fertility and prosperity, which is how we chose our name—bringing a piece of sunshine to every bowl we create. <br>\r\n<br>\r\nHawaiian cuisine itself is a beautiful symbiosis of diverse cultures, blending the best they have to offer: fresh fish, vibrant fruits, an abundance of vegetables, and unique sour-salty spices with a hint of heat.'),
