(3802, 288, 'heading_text', '<p>Aloha, sir or madam!</p>\r\n<p>Scotland is nothing like Hawaii, innit, my friend?)</p>\r\n<p>That doesn’t mean it is worse or better. Of course, no. But this warm, sweet Hawaiian sun... sometimes we just need it so hard.</p>\r\n<p>So we found a solution. And you don’t even need to book a bungalow at the end of the day. Just order fresh Hawaiian Poke Bowls in Edinburgh from Papa Poke.</p>\r\n'),
