(3940, 294, 'philosophy_text', '<h2>Our Philosophy</h2>\r\nPapapoké was created by a passionate team from Ukraine who brought their love for fresh food and modern dining to Scotland.\r\n\r\nWe combine global food trends with local quality, delivering bowls and rolls that are simple, honest, and full of flavour.\r\n\r\nFor us, it’s more than just food – it’s about sharing energy, creativity, and good vibes with every guest.'),
(3941, 294, '_philosophy_text', 'field_68b194a8be629'),
(3942, 294, 'philosophy_picture', '293'),
