(4598, 342, 'about_us_heading', 'Our Bowl  Love Story '),
(4599, 342, '_about_us_heading', 'field_6386506235454'),
(4600, 342, 'about_us_left_text', 'We drew inspiration from Papa, the Hawaiian goddess of fertility and prosperity, which is how we chose our name—bringing a piece of sunshine to every bowl we create. <br>\r\n<br>\r\nHawaiian cuisine itself is a beautiful symbiosis of diverse cultures, blending the best they have to offer: fresh fish, vibrant fruits, an abundance of vegetables, and unique sour-salty spices with a hint of heat.'),
(4601, 342, '_about_us_left_text', 'field_6386507135455'),
(4602, 342, 'about_us_right_text', 'Poke is a healthy and nourishing choice, rooted in love and respect for both the planet and your body.\r\n\r\nWe take pride in offering freshly prepared Poke Bowls, crafted using traditional methods, the freshest fish, and only the finest ingredients.'),
(4603, 342, '_about_us_right_text', 'field_6386508735456'),
(4604, 342, 'about_us_heading2', 'TEAM'),
(4605, 342, '_about_us_heading2', 'field_638650cc5e778'),
(4606, 342, 'about_us_text', 'And we promise our Hawaiian bowls will truly bowl you over.\r\n\r\nDon’t wait—try one today!'),
(4607, 342, '_about_us_text', 'field_638650e15e779'),
