(4854, 375, '_philosophy', 'field_68b194a1be628'),
(4855, 376, 'about_us_heading', 'Our Bowl  Love Story '),
(4856, 376, '_about_us_heading', 'field_6386506235454'),
(4857, 376, 'about_us_left_text', 'We drew inspiration from Papa, the Hawaiian goddess of fertility and prosperity, which is how we chose our name—bringing a piece of sunshine to every bowl we create. <br>\r\n<br>\r\nHawaiian cuisine itself is a beautiful symbiosis of diverse cultures, blending the best they have to offer: fresh fish, vibrant fruits, an abundance of vegetables, and unique sour-salty spices with a hint of heat.'),
(4858, 376, '_about_us_left_text', 'field_6386507135455'),
(4859, 376, 'about_us_right_text', 'Poke is a healthy and nourishing choice, rooted in love and respect for both the planet and your body.\r\n\r\nWe take pride in offering freshly prepared Poke Bowls, crafted using traditional methods, the freshest fish, and only the finest ingredients.'),
(4860, 376, '_about_us_right_text', 'field_6386508735456'),
(4861, 376, 'about_us_heading2', 'TEAM'),
