(112, 'tiktok-spc_june-2023', 'marketing', 'en_US', 'Take the guesswork out of TikTok advertising', 'Save time and create smarter ads using new automated campaign management from TikTok for WooCommerce. Simplify your campaign creation and watch TikTok’s machine learning build, target, and optimize ads that support your advertising goals — and grow your audience.', '{}', 'unactioned', 'woocommerce.com', '2023-06-30 09:52:08', NULL, 0, 'plain', '', 0, 0, 'info');
INSERT INTO `ihkw_wc_admin_notes` (`note_id`, `name`, `type`, `locale`, `title`, `content`, `content_data`, `status`, `source`, `date_created`, `date_reminder`, `is_snoozable`, `layout`, `image`, `is_deleted`, `is_read`, `icon`) VALUES
(113, 'woocommerce-WCGC-July-2023-update-needed', 'update', 'en_US', 'Action required: Security update of WooCommerce GoCardless Extension', '<strong>Your shop requires a security update to address a vulnerability in the WooCommerce GoCardless extension</strong>. The fix for this vulnerability was released on July 4th. Please update immediately.', '{}', 'pending', 'woocommerce.com', '2023-07-04 16:07:27', NULL, 0, 'plain', '', 0, 0, 'info'),
(114, 'woocommerce-shipping-fedex-api-outage-2023-07-16', 'warning', 'en_US', 'Scheduled FedEx API outage — July 2023', 'On July 16 there will be a full outage of the FedEx API from 04:00 to 08:00 AM UTC. Due to planned maintenance by FedEx, you\'ll be unable to provide FedEx shipping rates during this time. Follow the link below for more information and recommendations on how to minimize impact.', '{}', 'pending', 'woocommerce.com', '2023-07-06 16:28:08', NULL, 0, 'plain', '', 0, 0, 'info'),
(115, 'wcship-2023-07-hazmat-update-needed', 'update', 'en_US', 'Action required: USPS HAZMAT compliance update for WooCommerce Shipping & Tax extension', '<strong>Your store requires an update for the WooCommerce Shipping extension</strong>. Please update to the latest version of the WooCommerce Shipping &amp; Tax extension immediately to ensure compliance with new USPS HAZMAT rules currently in effect.', '{}', 'pending', 'woocommerce.com', '2023-07-11 21:49:31', NULL, 0, 'plain', '', 0, 0, 'info'),
(116, 'square_payments_q3_2023', 'marketing', 'en_US', 'Square for WooCommerce', 'Connect your Square account with WooCommerce to accept online and in-person payments (including contactless payments and cross-channel gift cards) quickly and securely. Save time by syncing sales, customers, and items and inventory — and manage everything through one centralized platform.', '{}', 'unactioned', 'woocommerce.com', '2023-07-19 13:59:13', NULL, 0, 'plain', '', 0, 0, 'info'),
(117, 'wc-admin-woopayments-rebrand', 'marketing', 'en_US', 'WooCommerce Payments is now WooPayments', 'We’ve changed the name as part of recent updates to the Woo brand. You’ll still enjoy the same seamless payments experience — just look for WooPayments in your WordPress admin.', '{}', 'pending', 'woocommerce.com', '2023-07-29 07:03:18', NULL, 0, 'plain', '', 0, 0, 'info'),
(118, 'woocommerce-WCStripe-Aug-2023-update-needed', 'update', 'en_US', 'Action required: Security update for WooCommerce Stripe plugin', '<strong>Your shop requires an important security update for the  WooCommerce Stripe plugin</strong>. The fix for this vulnerability was released on July 31. Please update immediately.', '{}', 'pending', 'woocommerce.com', '2023-08-03 10:24:23', NULL, 0, 'plain', '', 0, 0, 'info'),
(119, 'woocommerce-WCStripe-Aug-2023-security-updated', 'update', 'en_US', 'Security update of WooCommerce Stripe plugin', '<strong>Your store has been updated to the latest secure version of the WooCommerce Stripe plugin</strong>. This update was released on July 31.', '{}', 'pending', 'woocommerce.com', '2023-08-03 10:24:23', NULL, 0, 'plain', '', 0, 0, 'info'),
(120, 'woocommerce-WooPayments-Aug-2023-update-needed', 'update', 'en_US', 'Action required: Security update for WooPayments (WooCommerce Payments) plugin', '<strong>Your shop requires an important security update for the WooPayments (WooCommerce Payments) extension</strong>. The fix for this vulnerability was released on July 31. Please update immediately.', '{}', 'pending', 'woocommerce.com', '2023-08-03 10:24:23', NULL, 0, 'plain', '', 0, 0, 'info'),
(121, 'woocommerce-WooPayments-Aug-2023-security-updated', 'update', 'en_US', 'Security update of WooPayments (WooCommerce Payments) plugin', '<strong>Your store has been updated to the more secure version of WooPayments (WooCommerce Payments)</strong>. This update was released on July 31.', '{}', 'pending', 'woocommerce.com', '2023-08-03 10:24:23', NULL, 0, 'plain', '', 0, 0, 'info'),
(122, 'tiktok-apac-webinar-2023', 'marketing', 'en_US', 'Unlocking TikTok: Live Webinar August 9', 'Join us on August 9 for a free online masterclass with our partners at TikTok, tailored to Woo merchants in the APAC region (11 am AEST). You’ll learn how to connect your store to TikTok, unlock expert advertising tools, and reach its one billion active global users — all from the comfort of your own home.', '{}', 'pending', 'woocommerce.com', '2023-08-04 17:08:20', NULL, 0, 'plain', '', 0, 0, 'info'),
(123, 'wc-admin-performance-on-mobile', 'info', 'en_US', 'Track your store performance on mobile', 'Monitor your sales and high performing products with the Woo app.', '{}', 'unactioned', 'woocommerce-admin', '2023-08-08 10:50:37', NULL, 0, 'plain', '', 0, 0, 'info'),
(124, 'avalara_q3-2023_noAvaTax', 'marketing', 'en_US', 'Automatically calculate VAT in real time', 'Take the effort out of determining tax rates and sell confidently across borders with automated tax management from Avalara AvaTax— including built-in VAT calculation when you sell into or across the EU and UK. Save time and stay compliant when you let Avalara do the heavy lifting.', '{}', 'pending', 'woocommerce.com', '2023-08-09 15:27:45', NULL, 0, 'plain', '', 0, 0, 'info'),
(125, 'avalara_q3-2023_withAvaTax', 'marketing', 'en_US', 'New in AvaTax: Calculate VAT in real time', 'Take the effort out of determining tax rates and sell confidently across borders with automated tax management from Avalara AvaTax— including built-in VAT calculation when you sell into or across the EU and UK. Save time and stay compliant when you let Avalara do the heavy lifting.', '{}', 'pending', 'woocommerce.com', '2023-08-09 15:27:45', NULL, 0, 'plain', '', 0, 0, 'info'),
(126, 'google_uxstudy_recruitment_q3-2023', 'marketing', 'en_US', 'Share your feedback in exchange for $150', 'Woo has teamed up with Google to collect feedback on advertising products and services available to you. If selected, you’ll receive an incentive equal to $150 USD for a 60-minute interview that can help improve the products you use to advertise. If interested, please take 2 minutes to complete the screening survey.', '{}', 'pending', 'woocommerce.com', '2023-08-10 10:25:08', NULL, 0, 'plain', '', 0, 0, 'info'),
(127, 'woo-activation-survey-blockers-22AUG23', 'info', 'en_US', 'How can we help you get that first sale?', 'Your feedback is vital. Please take a minute to share your experience of setting up your new store and whether anything is preventing you from making those first few sales. Together, we can make Woo even better!', '{}', 'pending', 'woocommerce.com', '2023-08-23 08:59:03', NULL, 0, 'plain', '', 0, 0, 'info'),
(128, 'tiktok_shopGTM_q3-2023_noTikTok', 'marketing', 'en_US', 'You can now sell your products on TikTok Shop', 'TikTok is changing the way shoppers find and connect with brands. With TikTok Shop, you can sync your entire catalog from within Woo and sell directly to TikTok users through in-feed videos, livestreams, and your product showcase tab.', '{}', 'pending', 'woocommerce.com', '2023-09-07 19:55:48', NULL, 0, 'plain', '', 0, 0, 'info'),
(129, 'tiktok_shopGTM_q3-2023_hasTikTok', 'marketing', 'en_US', 'You can now sell your products on TikTok Shop', 'TikTok is changing the way shoppers find and connect with brands. With TikTok Shop, you can sync your entire catalog from within Woo and sell directly to TikTok users through in-feed videos, livestreams, and your product showcase tab.', '{}', 'pending', 'woocommerce.com', '2023-09-07 19:55:48', NULL, 0, 'plain', '', 0, 0, 'info'),
(130, 'klaviyo_q3_2023', 'marketing', 'en_US', 'Build long lasting relationships with Klaviyo for WooCommerce', 'Increase customer engagement and boost conversions with powerful email and SMS automation from Klaviyo. Fully integrated with your Woo store, Klaviyo enables you to send personalized communications to your customers — ensuring that the right message is delivered at the right time for maximum impact.', '{}', 'pending', 'woocommerce.com', '2023-09-12 19:14:55', NULL, 0, 'plain', '', 0, 0, 'info'),
(131, 'wc_admin_BNPL_WCPay_Q3_2023', 'marketing', 'en_US', 'Afterpay and Affirm have arrived in WooCommerce Payments!', 'Give your customers more power with buy now, pay later from Afterpay and Affirm — now included as part of WooCommerce Payments! With this new integration, you can quickly offer a checkout option that converts sales and boosts average order value, all from within the same payments dashboard you already know.', '{}', 'pending', 'woocommerce.com', '2023-09-19 06:14:11', NULL, 0, 'plain', '', 0, 0, 'info'),
(132, 'wc_admin_afterpay_WCPay_Q3_2023', 'marketing', 'en_US', 'Afterpay has arrived in WooCommerce Payments!', 'Give your customers more power with buy now, pay later from Afterpay — now included as part of WooCommerce Payments! With this new integration, you can quickly offer a checkout option that converts sales and boosts average order value, all from within the same payments dashboard you already know.', '{}', 'pending', 'woocommerce.com', '2023-09-19 06:14:11', NULL, 0, 'plain', '', 0, 0, 'info'),
(133, 'woocommerce-usermeta-Sept2023-productvendors', 'update', 'en_US', 'Your store requires a security update', '<strong>Your shop needs an update to address a vulnerability in WooCommerce.</strong> The fix was released on Sept 15. Please update WooCommerce to the latest version immediately. <a href=\"https://developer.woocommerce.com/2023/09/16/woocommerce-vulnerability-reintroduced-from-7-0-1/\" />Read our developer update</a> for more information.', '{}', 'pending', 'woocommerce.com', '2023-09-23 14:39:29', NULL, 0, 'plain', '', 0, 0, 'info'),
(134, 'Klarna_10OCT23', 'marketing', 'en_US', 'Klarna is now available', 'This is a test. Klarna is now available.', '{}', 'pending', 'woocommerce.com', '2023-10-11 12:42:00', NULL, 0, 'plain', '', 0, 0, 'info'),
(135, 'wc_com_in_person_payments_card_sale_US_inbox_note_q4_23', 'marketing', 'en_US', 'Save 35% on a WooPayments card reader', 'Have you been thinking about selling your products or services in person? Now’s the perfect time to do so, as we’re discounting our M2 card readers by 35%! Securely process payments wherever your business takes you, with full store and inventory sync. Don’t miss out — this offer ends October 29, 2023.', '{}', 'pending', 'woocommerce.com', '2023-10-13 11:16:50', NULL, 0, 'plain', '', 0, 0, 'info'),
(136, 'wc_com_in_person_payments_card_sale_UK_inbox_note_q4_23', 'marketing', 'en_US', 'Save 35% on a WooPayments card reader', 'Have you been thinking about selling your products or services in person? Now’s the perfect time to do so, as we’re discounting our WisePad 3 card readers by 35%! Securely process payments wherever your business takes you, with full store and inventory sync. Don’t miss out — this offer ends 29th October 2023.', '{}', 'pending', 'woocommerce.com', '2023-10-13 11:16:50', NULL, 0, 'plain', '', 0, 0, 'info'),
(137, 'wc_com_in_person_payments_card_sale_CA_inbox_note_q4_23', 'marketing', 'en_US', 'Save 35% on a WooPayments card reader', 'Have you been thinking about selling your products or services in person? Now’s the perfect time to do so, as we’re discounting our WisePad 3 card readers by 35%! Securely process payments wherever your business takes you, with full store and inventory sync. Don’t miss out — this offer ends October 29, 2023.', '{}', 'pending', 'woocommerce.com', '2023-10-13 11:16:50', NULL, 0, 'plain', '', 0, 0, 'info'),
(138, 'woocommerce-STRIPE-Oct-2023-update-needed', 'update', 'en_US', 'Action required: Security update for WooCommerce Stripe Gateway', '<strong>Your shop requires a security update to address a vulnerability in the WooCommerce Stripe Gateway</strong>. The fix for this vulnerability was released on October 17. Please update immediately.', '{}', 'pending', 'woocommerce.com', '2023-10-20 08:31:07', NULL, 0, 'plain', '', 0, 0, 'info'),
(139, 'wc_admin_WooPay_Q4_2023', 'marketing', 'en_US', 'Convert more sales with our fastest checkout yet', 'Enable WooPay and offer the only single-click checkout experience built by Woo, for Woo. Give shoppers the power to pay instantly and securely speed through checkout, even if it\'s their first visit. Add it for free with one tap in your WooPayments dashboard.', '{}', 'pending', 'woocommerce.com', '2023-10-30 10:15:59', NULL, 0, 'plain', '', 0, 0, 'info'),
(140, 'wc_admin_WooPay_Oct30_2023', 'marketing', 'en_US', 'Convert more sales with our fastest checkout yet', 'Enable WooPay and offer the only single-click checkout experience built by Woo, for Woo. Give shoppers the power to pay instantly and securely speed through checkout, even if it\'s their first visit. Add it for free with one tap in your WooPayments dashboard.', '{}', 'pending', 'woocommerce.com', '2023-11-04 04:30:16', NULL, 0, 'plain', '', 0, 0, 'info'),
(141, 'paypal_paylater_q4_23', 'marketing', 'en_US', 'Boost your sales this holiday season with PayPal', 'Set yourself up for success this holiday season by allowing customers to pay the way they prefer. With the latest version of PayPal Payments, you can accept PayPal, Venmo (US), Pay Later*, credit and debit cards, and popular alternative payment methods in one secure solution.', '{}', 'pending', 'woocommerce.com', '2023-11-07 19:02:13', NULL, 0, 'plain', '', 0, 0, 'info'),
(142, 'wc-admin-edit-products-on-the-move', 'info', 'en_US', 'Edit products on the move', 'Edit and create new products from your mobile devices with the Woo app', '{}', 'unactioned', 'woocommerce-admin', '2023-11-12 07:37:28', NULL, 0, 'plain', '', 0, 0, 'info'),
(143, 'tap_to_pay_iphone_q4_2023_no_woopayments', 'marketing', 'en_US', 'Accept in-person contactless payments on your iPhone', 'Tap to Pay on iPhone and WooPayments is quick, secure, and simple to set up — no extra terminals or card readers are needed. Accept contactless debit and credit cards, Apple Pay, and other NFC digital wallets in person.', '{}', 'pending', 'woocommerce.com', '2023-12-05 18:41:50', NULL, 0, 'plain', '', 0, 0, 'info'),
(144, 'tap_to_pay_iphone_q4_2023_with_woopayments', 'marketing', 'en_US', 'Accept in-person contactless payments on your iPhone', 'Tap to Pay on iPhone is quick, secure, and simple to set up in WooPayments — no extra terminals or card readers are needed. Accept contactless debit and credit cards, Apple Pay, and other NFC digital wallets in person in a few short steps!', '{}', 'pending', 'woocommerce.com', '2023-12-05 18:41:50', NULL, 0, 'plain', '', 0, 0, 'info'),
(145, 'amazon-mcf-reviews-2023-12-07', 'marketing', 'en_US', 'Enjoying Amazon MCF for WooCommerce?', 'We\'re Never Settle, the developers behind Amazon MCF for WooCommerce, and would be deeply honored to have your review. Reviews help immensely as other users can learn how MCF can solve their needs too! Not happy or need help? Please reach out for support and we’d love to make things right!', '{}', 'pending', 'woocommerce.com', '2023-12-07 04:25:26', NULL, 0, 'plain', '', 0, 0, 'info'),
(146, 'remove_estimated_deposits_2024', 'marketing', 'en_US', 'Estimated deposits are going away', 'To provide more accurate deposit information and support the expansion of instant deposits, estimated deposit details will no longer be available in WooPayments. We recommend upgrading to the latest version of WooPayments for more detailed balance status information.', '{}', 'pending', 'woocommerce.com', '2024-01-23 15:51:43', NULL, 0, 'plain', '', 0, 0, 'info'),
(147, 'amazon_pay_reactivate_q1-24', 'marketing', 'en_US', 'Special offer: Activate 0% promo rate for Amazon Pay', 'For a limited time, Woo merchants who register with Amazon Pay can enjoy a promotional rate of 0% on all transaction fees for 30 days. Valid for businesses based in the United Kingdom. Terms and conditions apply.', '{}', 'pending', 'woocommerce.com', '2024-01-27 03:49:27', NULL, 0, 'plain', '', 0, 0, 'info'),
(148, 'custom_order_attribution_inbox_q1_2024', 'marketing', 'en_US', 'NEW: Custom Order Attribution', 'Order attribution tracking is now available for all Woo stores! See whether an order came from a search ad, video, or email. Make better marketing decisions and watch your products go from “maybe” to “must-have.”', '{}', 'pending', 'woocommerce.com', '2024-02-06 14:42:53', NULL, 0, 'plain', '', 0, 0, 'info'),
(149, 'wc_admin_UKpricingchange_WCPay_Q1_2024', 'marketing', 'en_US', 'Fee Changes for WooPayments in the EEA and UK', 'WooPayments fees for transactions between the EEA and UK will change as of 1st March, 2024. Transactions between the UK and EEA are now deemed by card networks to be cross-border, thus international payment fees will be applicable. This also changes base processing fees.', '{}', 'pending', 'woocommerce.com', '2024-03-02 13:58:49', NULL, 0, 'plain', '', 0, 0, 'info'),
(150, 'airwallex_q1_2024', 'marketing', 'en_US', 'Save big on foreign exchange (FX) fees', 'Boost your international sales by offering Apple Pay, Google Pay, and 60+ local payment methods with Airwallex. Save time and money by settling payments directly in USD, EUR, HKD, SGD, AUD, and more — without the extra FX fees. Simple, cost-effective, fast.', '{}', 'unactioned', 'woocommerce.com', '2024-03-02 13:58:49', NULL, 0, 'plain', '', 0, 0, 'info'),
(151, 'bfcm2024-landing-page', 'marketing', 'en_US', 'The best way to prepare for holiday success', 'The upcoming holiday season is the busiest time of the year for many online stores. We want to help you make the most of it with an early gift: our first-ever Black Friday Cyber Monday Trends Report. It\'s full of stats, trends, and recommendations to knock your holiday socks off!', '{}', 'pending', 'woocommerce.com', '2024-09-06 06:32:26', NULL, 0, 'plain', '', 0, 0, 'info'),
(152, 'stripe_securityupdate_q3_2024', 'update', 'en_US', 'Security update required for your Stripe extension', 'To continue securely accepting payments, you must update your Stripe extension to at least version 8.6, re-authenticate, and turn on the new checkout experience. Review the documentation for instructions on how to make the necessary changes from your WooCommerce dashboard.', '{}', 'pending', 'woocommerce.com', '2024-09-19 01:11:58', NULL, 0, 'plain', '', 0, 0, 'info'),
(153, 'paypal_migration_Q3_2024', 'marketing', 'en_US', 'You’re using an outdated version of PayPal', 'Don\'t miss out on potential sales this holiday season — upgrade your store\'s checkout experience by switching to the all-in-one PayPal Payments extension. Enable customers to pay using Venmo and Pay Later (where available), credit and debit cards, Apple Pay, Google Pay, and country-specific options.', '{}', 'pending', 'woocommerce.com', '2024-10-04 11:02:02', NULL, 0, 'plain', '', 0, 0, 'info'),
(154, 'mollie_q4_2024', 'marketing', 'en_US', 'Special offer: Zero transaction fees for your first month with Mollie', 'With seamless checkout, flexible financing, and 30+ local and global payment methods, Mollie is the all-in-one payment solution that enhances the customer experience and helps your business grow. Start your account today and enjoy ZERO transaction fees for the first month. Ts&amp;Cs apply.', '{}', 'pending', 'woocommerce.com', '2024-10-31 15:43:49', NULL, 0, 'plain', '', 0, 0, 'info'),
(155, 'paypal_migration_Q3_2024_v2', 'marketing', 'en_US', 'You’re using an outdated version of PayPal', 'Don\'t miss out on potential sales this holiday season — upgrade your store\'s checkout experience by switching to the all-in-one PayPal Payments extension. Enable customers to pay using Venmo and Pay Later (where available), credit and debit cards, Apple Pay, Google Pay, and country-specific options.', '{}', 'pending', 'woocommerce.com', '2024-10-31 15:43:49', NULL, 0, 'plain', '', 0, 0, 'info'),
(156, 'wc-payments-notes-multi-currency-available', 'info', 'en_US', 'Sell worldwide in multiple currencies', 'Boost your international sales by allowing your customers to shop and pay in their local currency.', '{}', 'unactioned', 'woocommerce-payments', '2024-11-11 14:45:30', NULL, 0, 'plain', '', 0, 1, 'info'),
(157, 'sirt-woo-2024-11-xss-admin', 'update', 'en_US', 'An important update is required for WooCommerce', 'This update addresses a security vulnerability that could allow unauthorized access to administrative privileges on your site. <a href=\"https://developer.woocommerce.com/2024/12/03/woocommerce-9-4-3-and-woocommerce-9-3-4-available-now/\">Learn more</a>.\r\n<br><br>\r\n<strong>Please ensure your site is updated to the latest version to stay secure.</strong>', '{}', 'pending', 'woocommerce.com', '2024-12-05 15:27:07', NULL, 0, 'plain', '', 0, 0, 'info'),
(158, 'usps-mail-service-to-canada-suspended-dec-2024', 'update', 'en_US', 'Please note: USPS Mail Service to Canada Suspended', 'The United States Postal Service has temporarily suspended mail service to Canada due to the ongoing Canadian postal workers\' strike. USPS is asking users to refrain from mailing items to Canada at this time.', '{}', 'pending', 'woocommerce.com', '2024-12-05 15:27:07', NULL, 0, 'plain', '', 0, 0, 'info'),
(160, 'account-creation-after-checkout-dec2024', 'marketing', 'en_US', 'Offer account creation after checkout', 'Your customers can now create accounts after they check out on block-based themes. Enable the new “After checkout” block in your account settings and enjoy smoother guest checkout, better conversion, and more repeat business.', '{}', 'pending', 'woocommerce.com', '2024-12-19 10:30:39', NULL, 0, 'plain', '', 0, 0, 'info'),
(161, 'woocommerce-analytics-order-attribution-promotions-december-2024', 'marketing', 'en_US', 'Discover what drives your sales', 'Use our powerful <strong>Order Attribution</strong> extension to understand what truly drives your revenue. Track your sales journey, identify your most effective marketing channels, and optimize your sales strategy.', '{}', 'unactioned', 'woocommerce.com', '2024-12-23 10:25:54', NULL, 0, 'plain', '', 0, 0, 'info'),
(162, 'affirm_promo_Q1_2025', 'marketing', 'en_US', 'Save up to 50% on merchant fees with Affirm', 'Kickstart the year with buy now, pay later and get merchant rates as low as 2.9% + 30¢ per transaction for 30 days. Download the extension and complete your application from your WooCommerce dashboard by February 19, 2025 to claim the offer. Terms and conditions apply.', '{}', 'pending', 'woocommerce.com', '2025-01-21 10:19:08', NULL, 0, 'plain', '', 0, 0, 'info'),
(163, 'new-woo-brand-announcement-feb4-2025', 'marketing', 'en_US', 'Meet the new Woo', 'WooCommerce has a new look, but underneath, we’re still the same customizable, open-source ecommerce platform you know and love. Plus, we’ve got some major improvements to our platform and product on the way.', '{}', 'pending', 'woocommerce.com', '2025-02-05 10:56:24', NULL, 0, 'plain', '', 0, 0, 'info'),
(164, 'paypal_bnpl_au_promo_Q1_2025', 'marketing', 'en_US', 'Australian shoppers can Pay in 4 with PayPal', 'Enable Pay in 4 messaging to let Australian customers know that they can pay over time while you get paid up front and in full. Pay in 4 is included in PayPal Payments at no additional cost. Eligible buyers can pay in four interest-free payments for purchases of $30 to $2,000 AUD. Terms apply.', '{}', 'pending', 'woocommerce.com', '2025-02-12 10:12:35', NULL, 0, 'plain', '', 0, 0, 'info'),
(165, 'stripe_stripetax_q1_2025', 'marketing', 'en_US', 'Say goodbye to your tax woes', 'Stripe Tax automatically applies the correct sales tax, VAT, or GST, saving time while keeping you compliant. And with simple automatic filing, you can stop stressing at tax time and focus on growing instead.', '{}', 'pending', 'woocommerce.com', '2025-02-19 11:12:06', NULL, 0, 'plain', '', 0, 0, 'info'),
(166, 'printful_promo_q1_2025', 'marketing', 'en_US', 'New: sell print-on-demand products, risk-free', 'Expand your product line with Printful, now available in the WooCommerce Marketplace. Sell custom products with no upfront costs or inventory. This trusted supplier prints, packages, and ships for you, so you can focus on growing your store — and your next big idea.', '{}', 'pending', 'woocommerce.com', '2025-02-26 09:48:58', NULL, 0, 'plain', '', 0, 0, 'info'),
(167, 'paypal-braintree-sdk-depreciation-2025-02-20', 'update', 'en_US', 'Update required for your PayPal Braintree extension', 'To continue securely accepting payments, you must update your PayPal Braintree extension to version 3.2.4 or newer before June 30, 2025. Your current extension version will not support payment processing after this date due to an SSL certificate update.', '{}', 'pending', 'woocommerce.com', '2025-03-04 10:31:26', NULL, 0, 'plain', '', 0, 0, 'info'),
(168, 'woo-marketplace-two-year-subscriptions-rin-2025-03-17', 'marketing', 'en_US', 'Save 20% on new two-year subscriptions', 'We’ve introduced 20% off two-year subscriptions for all products* in the WooCommerce Marketplace. Lock in long-term savings and make sure your store never misses a beat. \r\n\r\n*Some exclusions apply. New purchases only.', '{}', 'pending', 'woocommerce.com', '2025-03-17 11:35:59', NULL, 0, 'plain', '', 0, 0, 'info'),
(169, 'stripe_orderstatus_bug_q2_2025', 'update', 'en_US', 'Action Required: Update Order Status Manager', 'Update to the latest Order Status Manager (v1.15.5+) to ensure payments are captured. Your version of WooCommerce Order Status Manager can interfere with order processing for payment gateways (including WooCommerce Stripe Gateway v9.2.0+), which may cause orders to process without capturing payment.', '{}', 'pending', 'woocommerce.com', '2025-04-03 09:59:17', NULL, 0, 'plain', '', 0, 0, 'info'),
(170, 'viva_wallet_migration_q1_2025', 'update', 'en_US', 'Switch to the new Viva.com Smart Checkout', 'The Viva Wallet extension is no longer being updated and improved. To get the best Viva.com experience, move to the new Smart Checkout. It’s fast, secure, and fully compatible with the latest WooCommerce features.', '{}', 'pending', 'woocommerce.com', '2025-04-04 09:59:18', NULL, 0, 'plain', '', 0, 0, 'info'),
(171, 'WooCommerce-Stripe-Gateway-Update-April-2025', 'update', 'en_US', 'Action required: Update WooCommerce Stripe Gateway to v9.4.1', '<strong>An important update for WooCommerce Stripe Payment Gateway has been released</strong>. Version 9.4.1 addresses performance issues and payment method visibility problems that occurred in version 9.4.0. Please update as soon as possible for optimal store performance. Please read <a href=\"https://developer.woocommerce.com/2025/04/18/https://developer.woocommerce.com/2025/04/18/developer-advisory-stripe-payment-gateway-9-4-1-release/\" /> this advisory</a> for more information.', '{}', 'pending', 'woocommerce.com', '2025-04-19 10:18:34', NULL, 0, 'plain', '', 0, 0, 'info'),
(172, 'WooCommerce-Stripe-Gateway-Update-Info-April-2025', 'update', 'en_US', 'WooCommerce Stripe Gateway has been updated to v9.4.1', '<strong>WooCommerce Stripe Payment Gateway was recently updated</strong>. Version 9.4.1 addresses performance issues and payment method visibility problems that occurred in version 9.4.0. No further action is required. Please read <a href=\"https://developer.woocommerce.com/2025/04/18/https://developer.woocommerce.com/2025/04/18/developer-advisory-stripe-payment-gateway-9-4-1-release/\" /> this advisory post </a>for more information.', '{}', 'pending', 'woocommerce.com', '2025-04-19 10:18:34', NULL, 0, 'plain', '', 0, 0, 'info'),
(174, 'uk-vat-notice-2025-04-30', 'warning', 'en_US', 'UK VAT numbers are no longer supported', 'Due to recent HM Revenue &amp; Customs (HMRC) VAT API changes, your EU VAT Number for WooCommerce extension can no longer validate UK VAT numbers. HMRC now requires merchants to register an API key, which this extension does not currently support. We recommend EU/UK VAT Validation Manager for WooCommerce as a replacement', '{}', 'pending', 'woocommerce.com', '2025-05-05 10:41:09', NULL, 0, 'plain', '', 0, 0, 'info'),
(175, 'payson-retirement-2025', 'update', 'en_US', 'Payson Form Retirement', 'Svea Bank is discontinuing the Payson service; the last date for transactions is August 31, 2025. As a result, the Payson Form extension has been removed from WooCommerce.com. Documentation remains available.', '{}', 'pending', 'woocommerce.com', '2025-05-13 09:56:12', NULL, 0, 'plain', '', 0, 0, 'info'),
(176, 'paypal_q2_2025', 'marketing', 'en_US', 'Power up sales with Pay Later messaging', 'Help increase your sales and grow cart sizes by letting customers know they have flexible payment options. Merchants see up to an 11% sales lift when they add Pay Later messaging — plus, it integrates seamlessly with your PayPal checkout.', '{}', 'pending', 'woocommerce.com', '2025-05-22 10:58:12', NULL, 0, 'plain', '', 0, 0, 'info'),
(177, 'paypal-braintree-sdk-depreciation-2025-05-30', 'update', 'en_US', 'Action required: Update the PayPal Braintree extension', 'Your PayPal Braintree extension is using an outdated SDK and will stop processing payments after June 30, 2025, due to a root SSL certificate expiration. To avoid service disruption, update to version 3.2.4 or newer immediately.', '{}', 'pending', 'woocommerce.com', '2025-05-30 09:56:57', NULL, 0, 'plain', '', 0, 0, 'info'),
(178, 'tento_q2_2025', 'marketing', 'en_US', 'Get your free business credit score', 'Strong business credit is the key to better deals, stronger partnerships, and sustainable growth. Tento Business Credit Monitoring helps you catch risks early, secure better financing, and fuel smarter growth — with no impact to your credit.', '{}', 'pending', 'woocommerce.com', '2025-06-04 10:25:46', NULL, 0, 'plain', '', 0, 0, 'info'),
(179, 'woopayments-multibanco-alipay-wechat-launch-2025-06-23', 'marketing', 'en_US', 'Multibanco, AliPay and WeChat now available in WooPayments', 'Multibanco, AliPay, and WeChat Pay are now available in WooPayments! Offer trusted local payment methods to customers in key global markets and boost international sales. Geo restrictions apply.', '{}', 'pending', 'woocommerce.com', '2025-06-23 10:11:12', NULL, 0, 'plain', '', 0, 0, 'info'),
(180, 'woopayments-new-lpms-2025-06-30', 'marketing', 'en_US', 'Get the POS built specifically for Woo stores', 'Introducing WooCommerce POS, our new point-of-sale solution built to get you up and running quickly with in-person sales. Search products, scan barcodes, apply coupons, and send email receipts — right in the WooCommerce mobile app, with all of your online and physical sales synced in real time — no extra setup required', '{}', 'pending', 'woocommerce.com', '2025-06-30 10:13:58', NULL, 0, 'plain', '', 0, 0, 'info'),
(181, 'tiktok-webinar-promo-july2025', 'marketing', 'en_US', 'You\'re Invited: TikTok for WooCommerce Webinar', 'Join us for a free webinar with our friends at TikTok on Tuesday, July 8, at 4 pm UTC. We\'ll cover creative tips and best practices for making content that turns views into sales.', '{}', 'pending', 'woocommerce.com', '2025-06-30 10:13:58', NULL, 0, 'plain', '', 0, 0, 'info'),
(182, 'woopayments-grabpay-launch-2025-07-07', 'marketing', 'en_US', 'GrabPay now available in WooPayments', 'Offer GrabPay through WooPayments and make checkout easier for customers across Southeast Asia. Enable it today and expand your reach with a payment method they know and trust.', '{}', 'pending', 'woocommerce.com', '2025-07-07 10:46:31', NULL, 0, 'plain', '', 0, 0, 'info'),
(183, 'BFCM-25-Survey', 'marketing', 'en_US', 'You’re invited: Take our quick BFCM survey and get 25% off', 'We’re gathering insights on how businesses prepare for peak sales moments like Black Friday and Cyber Monday — so we can better support you. Take our quick 8-minute survey to share your thoughts and get 25% off your next WooCommerce extension as a thank you.', '{}', 'pending', 'woocommerce.com', '2025-07-15 12:12:56', NULL, 0, 'plain', '', 0, 0, 'info'),
(184, 'woohoo10-coupon', 'marketing', 'en_US', 'Celebrate and save with WooCommerce 10.0', 'To mark this milestone release, get 10% off extensions and themes in the official Woo Marketplace. Use code WOOHOO10 at checkout to save on essential tools that help grow your business. Offer ends August 15, 2025. Terms and conditions apply.', '{}', 'unactioned', 'woocommerce.com', '2025-07-22 11:00:43', NULL, 0, 'plain', '', 0, 0, 'info'),
(185, 'paypaladvantage_q3_2025', 'marketing', 'en_US', 'Add PayPal Checkout and earn up to $1,000*', 'PayPal Checkout can boost conversion by up to 46% and average order value by up to 62% with no disruption to your checkout. New US merchants who activate by August 31 save 25% on transaction fees for 6 months. Excludes Venmo. Terms apply.*', '{}', 'pending', 'woocommerce.com', '2025-07-23 10:56:30', NULL, 0, 'plain', '', 0, 0, 'info'),
(186, 'stripe_optimizedcheckout_upgrade_q3_2025', 'marketing', 'en_US', 'Upgrade for a faster, more flexible Stripe checkout', 'You\'re not on the latest WooCommerce Stripe Payment Gateway version. Upgrade to version 9.8 to access Stripe\'s Optimized Checkout Suite and leverage AI models to dynamically surface the most relevant payment methods for each customer, including BNPL, local options, and one-click Link checkout.', '{}', 'pending', 'woocommerce.com', '2025-08-13 09:50:23', NULL, 0, 'plain', '', 0, 0, 'info'),
(187, 'stripe_optimizedcheckout_enable_q3_2025', 'marketing', 'en_US', 'Unlock dynamic payments and sell more', 'You’re on the latest WooCommerce Stripe Payment Gateway — now unlock its full potential by enabling the Optimized Checkout Suite. It uses AI models to dynamically surface the most relevant payment methods for each customer, helping you boost conversions.', '{}', 'pending', 'woocommerce.com', '2025-08-14 10:25:56', NULL, 0, 'plain', '', 0, 0, 'info'),
(188, 'stripe_optimizedcheckout_promotion_q3_2025', 'marketing', 'en_US', 'Upgrade to Stripe for a faster, more flexible checkout', 'Unlock dynamic payments with Stripe’s Optimized Checkout Suite — now available with the WooCommerce Stripe Payment Gateway. Leverage AI models to dynamically surface the most relevant payment methods for each customer, including BNPL, local options, and one-click Link checkout.', '{}', 'pending', 'woocommerce.com', '2025-08-16 12:24:32', NULL, 0, 'plain', '', 0, 0, 'info'),
(189, 'woo-subscription-gifting-bundling-2025-08-18', 'marketing', 'en_US', 'Grow recurring revenue with gifting', 'WooCommerce Subscriptions now includes gifting. Customers can buy subscriptions for others, helping you reach new shoppers and grow recurring revenue with less effort. Update to the latest version of Subscriptions (7.8.0) to start offering gifting.', '{}', 'pending', 'woocommerce.com', '2025-08-20 12:51:14', NULL, 0, 'plain', '', 0, 0, 'info'),
(191, 'wc-admin-new-sales-record', 'info', 'en_US', 'New sales record!', 'Woohoo, August 28th was your record day for sales! Net sales was £179.65 beating the previous record of £33.00 set on December 14th.', '{\"old_record_date\":\"2022-12-14\",\"old_record_amt\":33,\"new_record_date\":\"2025-08-28\",\"new_record_amt\":179.650000000000005684341886080801486968994140625}', 'unactioned', 'woocommerce-admin', '2025-08-29 09:47:37', NULL, 0, 'plain', '', 0, 0, 'info'),
(192, 'stripe_optimizedcheckout_competitors_q3_2025', 'marketing', 'en_US', 'Upgrade to the official WooCommerce Stripe Payment Gateway', 'Unlock dynamic payments with Stripe’s Optimized Checkout Suite — now available with the WooCommerce Stripe Payment Gateway. Use AI models to dynamically surface the most relevant payment methods for each customer, including BNPL, local options, and one-click checkout with Link.', '{}', 'pending', 'woocommerce.com', '2025-08-29 09:47:38', NULL, 0, 'plain', '', 0, 0, 'info'),
(193, 'UPS-promo-RIN-WCS-Aug-25', 'marketing', 'en_US', 'Get up to $100 off your first UPS shipments', 'For a limited time, merchants new to UPS can get up to $10 off their first 10 UPS labels on WooCommerce Shipping. Simplify your shipping, lower costs, and keep customers happy with fast, affordable options built right into your store dashboard.', '{}', 'pending', 'woocommerce.com', '2025-09-10 11:57:22', NULL, 0, 'plain', '', 0, 0, 'info'),
(194, 'UPS-promo-RIN-WCST-Aug-25', 'marketing', 'en_US', 'Get up to $100 off your first UPS shipments', 'For a limited time, merchants new to UPS can get up to $10 off their first 10 UPS labels on WooCommerce Shipping. Simplify your shipping, lower costs, and keep customers happy with fast, affordable options built right into your store dashboard.', '{}', 'pending', 'woocommerce.com', '2025-09-10 11:57:22', NULL, 0, 'plain', '', 0, 0, 'info'),
(195, 'square_ordersync_upgrade_q3_2025', 'marketing', 'en_US', 'You asked, we delivered — order sync is here for Square', 'Update your Square extension to v5.0 to access <a href=\"https://woocommerce.com/document/woocommerce-square/sync-settings/sync-orders-between-woocommerce-and-square/\">automatic order syncing</a>. Manage your online sales in Square, keep reports accurate, and save time with order updates visible across both platforms.', '{}', 'pending', 'woocommerce.com', '2025-09-11 11:16:06', NULL, 0, 'plain', '', 0, 0, 'info'),
(196, 'klaviyo_q3_2025', 'marketing', 'en_US', 'Smarter marketing starts with Woo x Klaviyo', 'Personalize every customer interaction with Klaviyo, Woo\'s preferred marketing automation solution. Advanced segmentation based on real customer behavior lets you create email and SMS campaigns focused on driving loyalty and revenue. So you can grow sales while simplifying your stack.', '{}', 'pending', 'woocommerce.com', '2025-09-17 10:08:25', NULL, 0, 'plain', '', 0, 0, 'info'),
(197, 'pinterest_q3_20252', 'marketing', 'en_US', 'More visibility, smarter campaigns', 'Connect your store to Pinterest via the Conversions API, a new feature in the latest version of our official extension. Target the right shoppers, track performance, and optimize campaigns for more sales. Get started today — connect and sync your catalog using the Conversions API.', '{}', 'pending', 'woocommerce.com', '2025-09-24 09:49:31', NULL, 0, 'plain', '', 0, 0, 'info'),
(199, 'wc-payments-notes-set-https-for-checkout', 'info', 'en_US', 'Enable secure checkout', 'Enable HTTPS on your checkout pages to display all available payment methods and protect your customers data.', '{}', 'unactioned', 'woocommerce-payments', '2025-11-24 16:39:43', NULL, 0, 'plain', '', 0, 0, 'info');
